import styled from "styled-components";

const Boton = styled.button`
    background: #fff; /* Green */
    color: #503459;
    padding: 10px 25px;
    text-align: center;
    font-size: 16px;
    border: black;
    border-radius: 8px;

    &:hover{
        background-color: #81638b; /* Green */
        color: #dac9df;
    }
`;

export default Boton;
